import React from 'react';
import { FaAddressBook } from 'react-icons/fa';
import './Navbar.css';

function Navbar({ onNavigate }) {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark px-3">
      <span className="navbar-brand d-flex align-items-center">
        <FaAddressBook className="me-2" />
        ContactBook
      </span>
      <div className="ms-auto d-flex gap-3 text-white">
        <button className="btn btn-link nav-link text-white" onClick={() => onNavigate('saved')}>
          Saved Contacts
        </button>
        <button className="btn btn-link nav-link text-white" onClick={() => onNavigate('about')}>
          About Us
        </button>
      </div>
    </nav>
  );
}

export default Navbar;
